import React from 'react';
import './App.css';
import Nav from './Nav'
import About from './About'
import Register from './Register'
import Login from './Login'
import Question from './Question'
//import axios from 'axios';

function App(){
  return (
    <div className="App">
      <Nav />
      <About />
      <Register />
      <Login />
      <Question />
    </div>
  );
};

export default App;
